import React from 'react'
import IsFirstWelcome from './Component/IsFirstWelcome'
import LastWelcome from './Component/LastWelcome'

export default class Welcome extends React.Component {
    constructor(){
        super();
        this.state = {};
    }

    render(){
        let localValue = localStorage.getItem('firstName');
        let elem;
        if(localValue) {
            elem = <LastWelcome />
        } else {
            elem = <IsFirstWelcome />
        }
        return (
            <div className='welcome'>
               {elem}
            </div>
        );
    }
}
